SELECT LINEITEM.L_TAX, ORDERS.O_ORDERSTATUS, PARTSUPP.PS_PARTKEY, CUSTOMER.C_CUSTKEY, SUPPLIER.S_ADDRESS, NATION.N_NAME FROM LINEITEM, ORDERS, CUSTOMER, NATION, SUPPLIER, PARTSUPP WHERE ORDERS.O_TOTALPRICE = 176661.89 ORDER BY CUSTOMER.C_CUSTKEY DESC, LINEITEM.L_TAX DESC, NATION.N_NAME ASC, ORDERS.O_ORDERSTATUS DESC, SUPPLIER.S_ADDRESS DESC, PARTSUPP.PS_PARTKEY ASC;
